.btn-main2 {
  background-color: #fff;
  color: $blue;
  padding: 8px 50px;
  text-align: center;
  border: none;
  border-radius: 30px;
  transition: $transition;
  font-weight: bold;
  border: 2px solid $blue;
  &:hover {
    background-color: $blue;
    color: #fff;
  }
}

.btn-main {
  position: relative;
  background: linear-gradient(to left, $main, $second, $main);
  color: ghostwhite !important;
  overflow: hidden;
  border: 1px solid $main;
  border-radius: 0;
  span {
    position: relative;
    z-index: 10;
    transition: color 0.4s;
    display: inline-flex;
    align-items: center;
    color: $main;
  }
  &::after,
  &::before {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 0;
  }
  &::before {
    content: "";
    background: #fff;
    width: 120%;
    left: -10%;
    transform: skew(30deg);
    transition: transform 0.4s cubic-bezier(0.3, 1, 0.8, 1);
  }
  &:hover::before {
    transform: translate3d(100%, 0, 0);
  }
  &:hover {
    span {
      color: ghostwhite !important;
    }
  }
}

.btn-custom {
  background: linear-gradient(90deg, #fbe9b0 0%, $medium-gold 100%);
  color: #212529;
  border-radius: 0px;
  line-height: 38px;
  width: 100%;
  text-transform: uppercase;
  border: none;
  position: relative;
  overflow: hidden;
  color: #fff;
  padding: 0 30px;
  &:before {
    position: absolute;
    left: -145px;
    top: 0;
    height: 100%;
    width: 100%;
    content: "";
    background: #000;
    opacity: 0;
    transform: skew(40deg);
    transition: all 0.3s ease 0s;
    // left: 180px;
    opacity: 0;
  }
  &:hover:before {
    left: 500px;
    opacity: 0.3;
  }
  &.primary-btn {
    display: block;
    width: max-content;
  }
