input,
textarea {
  padding: 7px 14px;
  border-radius: 6px;
  border: 1px solid #c5c5c5;
  transition: all 0.2s linear;
  color: #333;
  &:hover {
    border: 1px solid #898989;
  }

  &:focus,
  &:focus-visible {
